import React,{Component} from 'react'
import Hello from './components/Hello'
import './App.css';
class App extends Component{
  render(){
    const myName = 'karthik yadav'
    return(
      <div className = "App">
        <h1>MSc Botany andhraUniversity</h1>
        <Hello name = {myName}/>
      </div>
    )
  }
}
export default App;
